import React from 'react';
import { getImageUrl } from './component/user';


function Avatar({size , person}){
    return(
        <img
        className="avatar"
        src="https://i.imgur.com/1bX5QH6.jpg"
        alt="Lin Lanying"
        width={size}
        height={size}
        />
    );
}
export default function Profile(){
    return(
        <div>
        <Avatar 
        size = {100}
        person = {{
        name : 'Ali',
        imageId: 'YfeOqp2'
        }}
        />
        <Avatar 
        size = {80}
        person = {{
        name : 'Ali',
        imageId: 'OKS67lh'
        }}
        />
        <Avatar 
        size = {60}
        person = {{
            name : 'Ali',
            imageId: '1bX5QH6'
        }}
        />
        </div>
    );

}
